// import logo from './logo.svg';
import './App.css';
import Navbar from './js/Navbar';
import Stocks from './js/Home';
import { BrowserRouter as Routes, Route } from 'react-router-dom';

function App() {
  return (
   <>
    <Navbar/>
      <div>
    <Routes>        
      <Route path="/"  element={<Stocks/>} />
    </Routes>
    </div>
    </>

  );
}

export default App;
